import { Instagram, Twitter, Youtube, Calendar, Mail } from 'lucide-react'
import './HomePage.css'
import poster from '../assets/poster.png'

const HomePage = () => {
    const socialLinks = [
        { icon: <Instagram size={18} />, href: 'https://instagram.com/onkaryadav', color: '#E4405F' },
        { icon: <Youtube size={18} />, href: 'https://www.youtube.com/@boi_onkar', color: '#FF0000' },
        { icon: <Twitter size={18} />, href: 'https://twitter.com/onkaryadav', color: '#1DA1F2' },
    ]


    return (
        <div className="homepage" style={{ backgroundImage: `url(${poster})` }}>
            <div className="overlay"></div>
            <div className="container">
//here should come the book my show cards 
                {/* Fixed Social Links Bar */}
                <div className="social-bar">
                    {socialLinks.map((link, i) => (
                        <a
                            key={i}
                            href={link.href}
                            target="_blank"
                            rel="noopener noreferrer"
                            className="social-btn"
                            style={{ backgroundColor: link.color }}
                        >
                            {link.icon}
                        </a>
                    ))}
                </div>

                <div className="footer">
                    <p>Â© {new Date().getFullYear()} Onkar Yadav</p>
                </div>
            </div>
        </div>
    )
}

export default HomePage
